#include<iostream>
using namespace std;

int fib(int n)
{
    if(n<=1)
        return n;
    return fib(n-1)+fib(n-2);
}

int main()
{
    int n;
    cout << "Enter nth : ";
    cin >> n;

    int value=fib(n);

    cout << n << "th fibonacchi number is: " << value;
    return 0;
}

